import React from 'react'
import './Header.css'

export const Header = () => {
  return (
    <div className='w-[100%] h-[100vh] background flex flex-col justify-center items-center relative'>
        <h1 className='text-[2xl]'>EAT. DRINK. PLAY.</h1>
        <h3>WELCOME TO SIDCUP FAMILY GOLF!</h3>
        <p>Sidcup Family Golf is a multipurpose golf facility located in Sidcup, South East London. Passionate about technology, player development and making golf fun and accessible to everyone.</p>
    </div>
  )
}
